def convert_to_hex(data_string):
    frames = data_string.split('},')
    converted_frames = []

    for frame in frames:
        frame = frame.strip().strip("{}")
        number_strings = frame.split(',')

        hex_strings = ['0x{:02X}'.format(int(number)) for number in number_strings if number.strip()]

        converted_frame = '{' + ','.join(hex_strings) + '}'
        converted_frames.append(converted_frame)

    converted_string = ',\n'.join(converted_frames)

    return converted_string


def convert_to_xbm(data_string):
    frames = data_string.split('},')
    all_frames_xbm = []

    for frame in frames:
        frame = frame.strip().strip("{}")
        if not frame:
            continue
        number_strings = frame.split(',')

        byte_strings = []
        for number in number_strings:
            binary_string = bin(int(number)).replace('0b', '').zfill(8)
            byte_strings.append(binary_string)

        hex_strings = []
        for i in range(0, len(byte_strings), 8):
            byte_string = ''.join(byte_strings[i:i+8])
            hex_string = '0x' + format(int(byte_string, 2), '02X')
            hex_strings.append(hex_string)

        xbm_frame = '{' + ', '.join(hex_strings) + '}'
        all_frames_xbm.append(xbm_frame)

    xbm_data = ',\n'.join(all_frames_xbm)
    return xbm_data


